import React, { useState, useEffect } from 'react';
import { Link, useHistory, useParams } from 'react-router-dom';
import EmployeeService from '../services/EmployeeService';

const AddEmployeeComponent = () => {

    const [employeeFirstName, setEmployeeFirstName] = useState('');
    const [employeeCode, setEmployeeCode] = useState('');
    const [employeeLastName, setEmployeeLastName] = useState('');
    const [emailId, setEmailId] = useState('');

    const [dateOfBirth, setDateOfBirth] = useState('');
    const [gender, setGender] = useState('');
    const [age, setAge] = useState('');
    const [position, setPosition] = useState('');
    const [currentAddressLine1, setCurrentAddressLine1] = useState('');
    const [currentAddressLine2, setCurrentAddressLine2] = useState('');
    const [currentCity, setCurrentCity] = useState('');
    const [currentPincode, setCurrentPincode] = useState('');
    const [permanentAddressLine1, setPermanentAddressLine1] = useState('');
    const [permanentAddressLine2, setPermanentAddressLine2] = useState('');
    const [permanentCity, setPermanentCity] = useState('');
    const [permanentPincode, setPermanentPincode] = useState('');
    const [mobile, setMobile] = useState('');
    const [emergencyContactName, setEmergencyContactName] = useState('');
    const [emergencyMobile, setEmergencyMobile] = useState('');
    const [companyMail, setCompanyMail] = useState('');
    const [officePhoneNo, setOfficePhoneNo] = useState('');
    const [officeCity, setOfficeCity] = useState('');
    const [reportingManagerMail, setReportingManagerMail] = useState('');
    const [hrMail, setHrMail] = useState('');
    const [previousCompany, setPreviousCompany] = useState('');
    const [previousCompanyJoinDate, setPreviousCompanyJoinDate] = useState('');
    const [previousCompanyEndDate, setPreviousCompanyEndDate] = useState('');
    const [projectCode, setProjectCode] = useState('');
    const [projectStartDate, setProjectStartDate] = useState('');
    const [projectEndDate, setProjectEndDate] = useState('');

    const [panCardNumber, setPanCardNumber] = useState('');
    const [aadharCardNumber, setAadharCardNumber] = useState('');
    const [bankName, setBankName] = useState('');
    const [ifscCode, setIfscCode] = useState('');
    const [bankBranch, setBankBranch] = useState('');
    const [basicSalary, setBasicSalary] = useState('');
    const [bonus, setBonus] = useState('');
    const [houseRentAllowance, setHouseRentAllowance] = useState('');
    const [medicalAllowance, setMedicalAllowance] = useState('');
    const [travelAllowance, setTravelAllowance] = useState('');
    const [pf, setPf] = useState('');
    const [tax, setTax] = useState('');
    const [ctc, setCtc] = useState('');

    const [errors, setErrors] = useState({});
    const history = useHistory();
    const { id } = useParams();

    const validate = () => {
        let formErrors = {};
        if (!employeeFirstName) formErrors.employeeFirstName = 'First name is required';
        if (!employeeLastName) formErrors.employeeLastName = 'Last name is required';
        if (!employeeCode) formErrors.employeeCode = 'Employee code is required';
        if (!emailId) {
            formErrors.emailId = 'Email is required';
        } else if (!/\S+@\S+\.\S+/.test(emailId)) {
            formErrors.emailId = 'Email is invalid';
        }
        if (!dateOfBirth) formErrors.dateOfBirth = 'Date of Birth is required';
        if (!mobile || !/^\d{10}$/.test(mobile)) {
            formErrors.mobile = 'Valid 10-digit mobile number is required';
        }
        if (!age || isNaN(age)) formErrors.age = 'Valid age is required';
        if (!currentPincode || isNaN(currentPincode)) formErrors.currentPincode = 'Current Pincode must be a number';
        if (!permanentPincode || isNaN(permanentPincode)) formErrors.permanentPincode = 'Permanent Pincode must be a number';
        if (!panCardNumber) formErrors.panCardNumber = 'PAN card number is required';
        if (!aadharCardNumber || aadharCardNumber.length !== 12) {
            formErrors.aadharCardNumber = 'Valid 12-digit Aadhar number is required';
        }
        if (!basicSalary || isNaN(basicSalary)) formErrors.basicSalary = 'Basic salary must be a valid number';
        if (!ctc || isNaN(ctc)) formErrors.ctc = 'CTC must be a valid number';

        setErrors(formErrors);
        return Object.keys(formErrors).length === 0;
    };

    const saveOrUpdateEmployee = (e) => {
        e.preventDefault();

        if (!validate()) {
            return;
        }

        const employee = {
            employeeFirstName, employeeCode, employeeLastName, emailId, dateOfBirth, gender,
            age, position, currentAddressLine1, currentAddressLine2, currentCity, currentPincode,
            permanentAddressLine1, permanentAddressLine2, permanentCity, permanentPincode, mobile,
            emergencyContactName, emergencyMobile, companyMail, officePhoneNo, officeCity,
            reportingManagerMail, hrMail, previousCompany, previousCompanyJoinDate, previousCompanyEndDate,
            projectCode, projectStartDate, projectEndDate, panCardNumber, aadharCardNumber, bankName,
            ifscCode, bankBranch, basicSalary, bonus, houseRentAllowance, medicalAllowance, travelAllowance,
            pf, tax, ctc
        };

        if (id) {
            EmployeeService.updateEmployee(id, employee).then(() => {
                history.push('/employees');
            }).catch(error => {
                console.log(error);
            });
        } else {
            EmployeeService.createEmployee(employee).then(() => {
                history.push('/employees');
            }).catch(error => {
                console.log(error);
            });
        }
    };

    useEffect(() => {
        if (id) {
            EmployeeService.getEmployeeById(id).then(response => {
                const employee = response.data;
                setEmployeeFirstName(employee.employeeFirstName);
                setEmployeeLastName(employee.employeeLastName);
                setEmployeeCode(employee.employeeCode);
                setEmailId(employee.emailId);
                setDateOfBirth(employee.dateOfBirth);
                setGender(employee.gender);
                setAge(employee.age);
                setPosition(employee.position);
                setCurrentAddressLine1(employee.currentAddressLine1);
                setCurrentAddressLine2(employee.currentAddressLine2);
                setCurrentCity(employee.currentCity);
                setCurrentPincode(employee.currentPincode);
                setPermanentAddressLine1(employee.permanentAddressLine1);
                setPermanentAddressLine2(employee.permanentAddressLine2);
                setPermanentCity(employee.permanentCity);
                setPermanentPincode(employee.permanentPincode);
                setMobile(employee.mobile);
                setEmergencyContactName(employee.emergencyContactName);
                setEmergencyMobile(employee.emergencyMobile);
                setCompanyMail(employee.companyMail);
                setOfficePhoneNo(employee.officePhoneNo);
                setOfficeCity(employee.officeCity);
                setReportingManagerMail(employee.reportingManagerMail);
                setHrMail(employee.hrMail);
                setPreviousCompany(employee.previousCompany);
                setPreviousCompanyJoinDate(employee.previousCompanyJoinDate);
                setPreviousCompanyEndDate(employee.previousCompanyEndDate);
                setProjectCode(employee.projectCode);
                setProjectStartDate(employee.projectStartDate);
                setProjectEndDate(employee.projectEndDate);
                setPanCardNumber(employee.panCardNumber);
                setAadharCardNumber(employee.aadharCardNumber);
                setBankName(employee.bankName);
                setIfscCode(employee.ifscCode);
                setBankBranch(employee.bankBranch);
                setBasicSalary(employee.basicSalary);
                setBonus(employee.bonus);
                setHouseRentAllowance(employee.houseRentAllowance);
                setMedicalAllowance(employee.medicalAllowance);
                setTravelAllowance(employee.travelAllowance);
                setPf(employee.pf);
                setTax(employee.tax);
                setCtc(employee.ctc);
            }).catch(error => {
                console.log(error);
            });
        }
    }, [id]);

    const title = () => {
        return id ? <h2 className="text-center">Update Employee</h2> : <h2 className="text-center">Add Employee</h2>;
    };

    return (
        <div>
            <br /><br />
            <div className="container">
                <div className="row">
                    <div className="card col-md-6 offset-md-3 offset-md-3">
                        {title()}
                        <div className="card-body">
                            <form>
                                <h3>Personal Details:</h3>
                                <div className="form-group mb-2">
                                    <label className="form-label">First Name:</label>
                                    <input
                                        type="text"
                                        placeholder="Enter first name"
                                        name="employeeFirstName"
                                        className="form-control"
                                        value={employeeFirstName}
                                        onChange={(e) => setEmployeeFirstName(e.target.value)}
                                    />
                                    {errors.employeeFirstName && <div className="text-danger">{errors.employeeFirstName}</div>}
                                </div>

                                {/* Add similar input fields for all other attributes with validation messages */}

                                <div className = "form-group mb-2">
                                    <label className = "form-label"> Last Name :</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter last name"
                                        name = "employeeLastName"
                                        className = "form-control"
                                        value = {employeeLastName}
                                        onChange = {(e) => setEmployeeLastName(e.target.value)}
                                    >

                                    </input>
                                    {errors.employeeLastName && <div className="text-danger">{errors.employeeLastName}</div>}
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label"> Employee Code</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter Employee Code"
                                        name = "employeeCode"
                                        className = "form-control"
                                        value = {employeeCode}
                                        onChange = {(e) => setEmployeeCode(e.target.value)}
                                    >
                                    </input>
                                    {errors.employeeLastName && <div className="text-danger">{errors.employeeLastName}</div>}

                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label"> Personal Email Id :</label>
                                    <input
                                        type = "email"
                                        placeholder = "Enter email Id"
                                        name = "emailId"
                                        className = "form-control"
                                        value = {emailId}
                                        onChange = {(e) => setEmailId(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Date Of Birth</label>
                                    <input
                                        type = "date"
                                        placeholder = "Enter DateOfBirth"
                                        name = "dateOfBirth"
                                        className = "form-control"
                                        value = {dateOfBirth}
                                        onChange = {(e) => setDateOfBirth(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Gender</label><br></br>
                                    <label className = "form-label" for="Male">Male</label>
                                    <input 
                                        display="inline"
                                        type = "radio"
                                        name = "Male"
                                        className = "form-control"
                                        value = {gender}
                                        onChange = {(e) => setGender(e.target.value)}
                                    >
                                    </input>
                                    <label className = "form-label" for="Female">Female</label>
                                    <input
                                        type = "radio"
                                        display="inline"
                                        name = "Female"
                                        className = "form-control"
                                        value = {gender}
                                        onChange = {(e) => setGender(e.target.value)}
                                    > 
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Age</label>
                                    <input
                                        type = "number"
                                        placeholder = "Enter Age"
                                        name = "age"
                                        className = "form-control"
                                        value = {age}
                                        onChange = {(e) => setAge(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Position</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter Position"
                                        name = "position"
                                        className = "form-control"
                                        value = {position}
                                        onChange = {(e) => setPosition(e.target.value)}
                                    >
                                    </input>
                                </div>
                                <h3>Address :</h3>
                                <div className = "form-group mb-2">
                                    <label className = "form-label">currentAddressLine1</label>
                                    <input
                                        type = "type"
                                        placeholder = "Enter current Address Line1"
                                        name = "currentAddressLine1"
                                        className = "form-control"
                                        value = {currentAddressLine1}
                                        onChange = {(e) => setCurrentAddressLine1(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Current Address Line2</label>
                                    <input
                                        type = "type"
                                        placeholder = "Enter current Address Line2"
                                        name = "currentAddressLine2"
                                        className = "form-control"
                                        value = {currentAddressLine2}
                                        onChange = {(e) => setCurrentAddressLine2(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Current City</label>
                                    <input
                                        type = "type"
                                        placeholder = "Enter City"
                                        name = "currentCity"
                                        className = "form-control"
                                        value = {currentCity}
                                        onChange = {(e) => setCurrentCity(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">City Pincode</label>
                                    <input
                                        type = "number"
                                        placeholder = "Enter PINCODE"
                                        name = "currentPincode"
                                        className = "form-control"
                                        value = {currentPincode}
                                        onChange = {(e) => setCurrentPincode(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Permanent Address Line1</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter Permanent Address"
                                        name = "permanentAddressLine1"
                                        className = "form-control"
                                        value = {permanentAddressLine1}
                                        onChange = {(e) => setPermanentAddressLine1(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Permanent Address Line2</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter Permanent Address"
                                        name = "permanentAddressLine2"
                                        className = "form-control"
                                        value = {permanentAddressLine2}
                                        onChange = {(e) => setPermanentAddressLine2(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Permanent City</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter Permanent City"
                                        name = "permanentCity"
                                        className = "form-control"
                                        value = {permanentCity}
                                        onChange = {(e) => setPermanentCity(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Permanent City PINCODE</label>
                                    <input
                                        type = "number"
                                        placeholder = "Enter Permanent City PINCODE"
                                        name = "permanentPincode"
                                        className = "form-control"
                                        value = {permanentPincode}
                                        onChange = {(e) => setPermanentPincode(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Mobile</label>
                                    <input
                                        type = "number"
                                        placeholder = "Enter Mobile"
                                        name = "mobile"
                                        className = "form-control"
                                        value = {mobile}
                                        onChange = {(e) => setMobile(e.target.value)}
                                    >
                                    </input>
                                </div>
                                <h3>Emergency Contact :</h3>
                                <div className = "form-group mb-2">
                                    <label className = "form-label">Name</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter emergencyContactName"
                                        name = "emergencyContactName"
                                        className = "form-control"
                                        value = {emergencyContactName}
                                        onChange = {(e) => setEmergencyContactName(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Number</label>
                                    <input
                                        type = "number"
                                        placeholder = "Enter Emergency Mobile No"
                                        name = "emergencyMobile"
                                        className = "form-control"
                                        value = {emergencyMobile}
                                        onChange = {(e) => setEmergencyMobile(e.target.value)}
                                    >
                                    </input>
                                </div>
                                <h3>Professional Details :</h3>
                                <div className = "form-group mb-2">
                                    <label className = "form-label">Company Mail</label>
                                    <input
                                        type = "email"
                                        placeholder = "Enter Company Email Id"
                                        name = "companyMail"
                                        className = "form-control"
                                        value = {companyMail}
                                        onChange = {(e) => setCompanyMail(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Office Number</label>
                                    <input
                                        type = "number"
                                        placeholder = "Enter Office Phone No"
                                        name = "officePhoneNo"
                                        className = "form-control"
                                        value = {officePhoneNo}
                                        onChange = {(e) => setOfficePhoneNo(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Office Location</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter Office City"
                                        name = "officeCity"
                                        className = "form-control"
                                        value = {officeCity}
                                        onChange = {(e) => setOfficeCity(e.target.value)}
                                    >
                                    </input>
                                </div>


                                <div className = "form-group mb-2">
                                    <label className = "form-label">Reporting Manager Mail</label>
                                    <input
                                        type = "email"
                                        placeholder = "Enter manager Mail ID"
                                        name = "reportingManagerMail"
                                        className = "form-control"
                                        value = {reportingManagerMail}
                                        onChange = {(e) => setReportingManagerMail(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">HR Name</label>
                                    <input
                                        type = "email"
                                        placeholder = "HR Mail ID"
                                        name = "hrMail"
                                        className = "form-control"
                                        value = {hrMail}
                                        onChange = {(e) => setHrMail(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">PreviousCompany Name</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter previousCompany name"
                                        name = "previousCompany"
                                        className = "form-control"
                                        value = {previousCompany}
                                        onChange = {(e) => setPreviousCompany(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">PreviousCompany Joining Date</label>
                                    <input
                                        type = "date"
                                        placeholder = "Enter previousCompany Joining Date"
                                        name = "previousCompanyJoinDate"
                                        className = "form-control"
                                        value = {previousCompanyJoinDate}
                                        onChange = {(e) => setPreviousCompanyJoinDate(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">PreviousCompany Ending Date</label>
                                    <input
                                        type = "date"
                                        placeholder = "Enter previousCompany Ending Date"
                                        name = "previousCompanyEndDate"
                                        className = "form-control"
                                        value = {previousCompanyEndDate}
                                        onChange = {(e) => setPreviousCompanyEndDate(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Project Code</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter Project Code"
                                        name = "projectCode"
                                        className = "form-control"
                                        value = {projectCode}
                                        onChange = {(e) => setProjectCode(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Project Start Date</label>
                                    <input
                                        type = "date"
                                        placeholder = "Enter Project Start Date"
                                        name = "projectStartDate"
                                        className = "form-control"
                                        value = {projectStartDate}
                                        onChange = {(e) => setProjectStartDate(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Project End Date</label>
                                    <input
                                        type = "date"
                                        placeholder = "Enter Project End Date"
                                        name = "projectEndDate"
                                        className = "form-control"
                                        value = {projectEndDate}
                                        onChange = {(e) => setProjectEndDate(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <h3> Finance Details </h3>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">PAN</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter PAN No"
                                        name = "panCardNumber"
                                        className = "form-control"
                                        value = {panCardNumber}
                                        onChange = {(e) => setPanCardNumber(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Aadhar</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter Aadhar No"
                                        name = "aadharCardNumber"
                                        className = "form-control"
                                        value = {aadharCardNumber}
                                        onChange = {(e) => setAadharCardNumber(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Basic Salary</label>
                                    <input
                                        type = "number"
                                        placeholder = "Enter Basic Salary"
                                        name = "basicSalary"
                                        className = "form-control"
                                        value = {basicSalary}
                                        onChange = {(e) => setBasicSalary(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Bonus</label>
                                    <input
                                        type = "number"
                                        placeholder = "Enter Bonus"
                                        name = "bonus"
                                        className = "form-control"
                                        value = {bonus}
                                        onChange = {(e) => setBonus(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">House Rent Allowance</label>
                                    <input
                                        type = "number"
                                        placeholder = "Enter HRA"
                                        name = "houseRentAllowance"
                                        className = "form-control"
                                        value = {houseRentAllowance}
                                        onChange = {(e) => setHouseRentAllowance(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Medical Allowance</label>
                                    <input
                                        type = "number"
                                        placeholder = "Medical Allowance"
                                        name = "medicalAllowance"
                                        className = "form-control"
                                        value = {medicalAllowance}
                                        onChange = {(e) => setMedicalAllowance(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Travel Allowance</label>
                                    <input
                                        type = "number"
                                        placeholder = "Travel Allowance"
                                        name = "travelAllowance"
                                        className = "form-control"
                                        value = {travelAllowance}
                                        onChange = {(e) => setTravelAllowance(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">pf</label>
                                    <input
                                        type = "number"
                                        placeholder = "pf"
                                        name = "pf"
                                        className = "form-control"
                                        value = {pf}
                                        onChange = {(e) => setPf(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">Tax</label>
                                    <input
                                        type = "number"
                                        placeholder = "tax"
                                        name = "tax"
                                        className = "form-control"
                                        value = {tax}
                                        onChange = {(e) => setTax(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">ctc</label>
                                    <input
                                        type = "number"
                                        placeholder = "ctc"
                                        name = "ctc"
                                        className = "form-control"
                                        value = {ctc}
                                        onChange = {(e) => setCtc(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <h3>Bank Details :</h3>
                                <div className = "form-group mb-2">
                                    <label className = "form-label">Bank Name</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter BankName"
                                        name = "bankName"
                                        className = "form-control"
                                        value = {bankName}
                                        onChange = {(e) => setBankName(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label">IFSC Code</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter ifscCode"
                                        name = "ifscCode"
                                        className = "form-control"
                                        value = {ifscCode}
                                        onChange = {(e) => setIfscCode(e.target.value)}
                                    >
                                    </input>
                                </div>



                                <div className = "form-group mb-2">
                                    <label className = "form-label">Branch Name</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter Bank Branch"
                                        name = "bankBranch"
                                        className = "form-control"
                                        value = {bankBranch}
                                        onChange = {(e) => setBankBranch(e.target.value)}
                                    >
                                    </input>
                                </div>





                                <button className="btn btn-success" onClick={saveOrUpdateEmployee}>Submit</button>
                                <Link to="/employees" className="btn btn-danger">Cancel</Link>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default AddEmployeeComponent;
